riod=self.params.di_period)\n        self.adxr.plotinfo.plotmaster = self.adx\n        # ADXR(high, low, close, timeperiod=14)\n        # \u8ba1\u7b97 +DI \u548c -DI\n        self.plus_di = bt.talib.PLUS_DI(self.data.high, self.data.low, self.data.close,\n                                        timeperiod=self.params.di_period)\n        self.minus_di = bt.talib.MINUS_DI(self.data.high, self.data.low, self.data.close,\n                                          timeperiod=self.params.di_period)\n        self.minus_di.plotinfo.plotmaster = self.plus_di\n\n        # \u8ba1\u7b97 APO\n        self.apo = bt.talib.APO(self.data, fastperiod=20, slowperiod=100, matype=3)\n\n        # \u8ba1\u7b97 AROON Up \u548c AROON Down\n        self.aroon = bt.talib.AROON(self.data.high, self.data.low, timeperiod=self.params.sma_period)\n        self.aroonosc = bt.talib.AROONOSC(self.data.high, self.data.low, timeperiod=self.params.sma_period)\n        self.aroonosc.plotinfo.plotmaster = self.aroon\n\n        # \u8ba1\u7b97 BOP\n        self.bop = bt.talib.BOP(self.data.open, self.data.high, self.data.low, self.data.close)\n\n        # self.buy_index = None\n        # self.sell_index = None\n        self.cci = bt.talib.CCI(self.data.high, self.data.low, self.data.close, timeperiod=PERIOD)\n        self.buy_index = self.cci &gt;= 100\n        self.sell_index = self.cci &lt;= -100\n        self.position_percent = 0\n        # \u5bf9\u7eb3\u6307\u6709\u6548\n        # \u8ba1\u7b97 CMO\n        self.cmo = bt.talib.CMO(self.data, timeperiod=PERIOD)\n\n        # \u5bf9\u7eb3\u6307\u6709\u6548\n        self.DX = bt.talib.DX(self.data.high, self.data.low, self.data.close, timeperiod=PERIOD)\n        self.DXR = bt.talib.EMA(self.DX, timeperiod=66)\n        self.plus_di = bt.talib.PLUS_DI(self.data.high, self.data.low, self.data.close,\n                                        timeperiod=PERIOD)\n        self.minus_di = bt.talib.MINUS_DI(self.data.high, self.data.low, self.data.close,\n s as 'ERR'.\n// Note, after this assignment statement, on next plot redrawing,\n// our override `doFormat` will be called directly\n// -- FunctionTickFormatter.doFormat(), i.e. _this_ code, no longer\n// executes.\n\naxis.formatter.doFormat = function (ticks) {\n    const dates = ticks.map(i =&gt; source.data.datetime[source.data.index.indexOf(i)]),\n        valid = t =&gt; t !== undefined,\n        labels = formatter.doFormat(dates.filter(valid));\n    let i = 0;\n    return dates.map(t =&gt; valid(t) ? labels[i++] : '');\n};\n\n// we do this manually only for the first time we are called\nconst labels = axis.formatter.doFormat(ticks);\nreturn labels[index];\n"},"id":"1035","type":"FuncTickFormatter"},{"attributes":{"source":{"id":"1153"}},"id":"1252","type":"CDSView"},{"attributes":{"args":{"hover":{"id":"1037"},"source":{"id":"1004"}},"code":"// args: source, hover\n// Hide NaN values from tooltips\nvar tmpl = Bokeh.require('core/util/templating');\nif (hover.defaults == undefined || hover.defaults == false) {\n    hover.defaults = hover.tooltips;\n}\nvar index = -1;\nif (cb_data.index.indices.length &gt; 0) {\n    index = cb_data.index.indices[0];\n} else {\n    // this is a workaround for a hit test bug:\n    // https://github.com/bokeh/bokeh/issues/8787\n    var column = source.get_column('index');\n    for (var i = 0; i &lt; column.length; i++) {\n        if (column[i] == parseInt(cb_data.geometry.x)) {\n            index = i;\n            break;\n        }\n    }\n}\nif (index &gt;= 0) {\n    var ttips = [];\n    for (var i = 0; i &lt; hover.defaults.length; i++) {\n        var val = tmpl.replace_placeholders(\n            hover.defaults[i][1], source, index);\n        if (val != 'NaN') {\n            ttips.push(hover.defaults[i]);\n        }\n    }\n    hover.tooltips = ttips;\n} else {\n    hover.tooltips = hover.defaults;\n}\n"},"id":"1038","type":"CustomJS"},{"attributes":{"css_classes":["panel-title"],"text":"Strategy Metadata Overview"},"id":"1549","ty
